export default function InputFrom({ icon, id, type, placeholder, value, onChange, required, autoComplete })
{
    return(
    <div className="flex items-center gap-x-2 w-full">
        <span className="mr-2">{icon}</span>
        <input
        id={id}
        type={type}
        placeholder={placeholder}
        value={value}
        onChange={(e) => onChange(e.target.value)}
        required={required}
        autoComplete={autoComplete}
        className="flex-1 min-w-0 px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-indigo-300"/>
    </div>
    );
}
